var callsignArray=[];if(localStorage.getItem("favourites")==null){}else{callsignArray=JSON.parse(localStorage.getItem("favourites"))}var planeObjects=[];if(localStorage.getItem("planes")==null){}else{planeObjects=JSON.parse(localStorage.getItem("planes"))}$(document).ready(function(){callsignArray.forEach(function(b){var a=$.grep(planeObjects,function(c){return c.callsign==b});console.log(a);$("#favouritesTable").append("<tr><td>"+a[0].callsign+"</td><td>"+a[0].departureAirport+"</td><td>"+a[0].arrivalAirport+"</td><td>"+a[0].departureLocal+"</td><td>"+a[0].arrivalLocal+"</td><td>"+a[0].delay+"</td><td>"+a[0].speed+"</td><td>"+a[0].altitude+"</td></tr>")})});